import mainContext from '../context/mainContext'

const TicketPage = () => {

    const {socket, purchasedTickets } = useContext(mainContext) 



  return (
    <div>
        {purchasedTickets.map((x,i) => (
            <div className="ticketgroup">

                {x.seats.map((seat, i) => (
                    <div className="singleticket">
                        <h3>Movie: {x.movie}</h3>
                        <p>Seat:{seat}</p>

                    </div>
                ))}
            </div>
        ))}
    </div>
  )
}

export default TicketPage
